/* iFrame Extension for Axel Springer (1/3)
 * 
 *  @author: Caleb Jaquith, Tealium Inc.
 *
 *  @purpose: manually trigger utag.link() inside parent frame to collect
 *            yet-to-be-speecified information from iframe forms.  
 *
 *  @scope: Pre Loader
 *
 */

// don't change this part
var utag_data = utag_data || {};
utag_data.ext = utag_data.ext || {};

// change these values as needed
utag_data.ext.iframeWrapperConfig = {
  // what to add to the utag.data object in the triggered utag.view
  'messageObjectOverrides' : {
    'event_type' : 'iframe_trigger',
    'iframe_partner' : 'kjero'
  },
  // how to recognize an embedded iframe
  'iframeDivId'        : 'iFrameResizer0',
  'iframeOrigin'       : 'http://calebjaquith.com'
};

