/* iFrame Extension for Axel Springer (2/3)

 *  @author: Caleb Jaquith, Tealium Inc.
 *
 *  @purpose: manually trigger utag.link() inside parent frame to collect
 *            yet-to-be-speecified information from iframe forms.  
 *
 *  @scope: All Tags
 *
 *  @execution: Before Load Rules
 */

// configuration settings should be set in a separate, Pre Loader scoped extension, nothing to change here.
var config = utag_data.ext.iframeWrapperConfig;

// don't do anything if the config is missing
if (typeof config != &quot;undefined&quot;) {
  var b = b || utag.data || {};
  if (typeof config.iframeDivId != &quot;undefined&quot;) {
    b.external_app_id = config.iframeDivId;
  }

  if (typeof b.external_app_id) {
    var frameCheck = document.getElementById(b.external_app_id);

    b.page_has_external_app = function() {
      if (frameCheck &amp;&amp; frameCheck.contentWindow){
        return true;
      }
      return false;
    }();
  }
}

