/* iFrame Extension for Axel Springer (4/4)
 *
 *  @author: Caleb Jaquith, Tealium Inc.
 *
 *  @purpose: manually trigger utag.link() inside parent frame to collect
 *            yet-to-be-speecified information from iframe forms.  
 *
 *  @scope: DOM Ready
 */

// configuration settings should be set in a separate, Pre Loader scoped extension
var config = utag_data.ext.iframeWrapperConfig;

// don't do anything if the config is missing
if (typeof config != &quot;undefined&quot;) {
  // to correct for extension scope if needed
  var b = b || utag.data || {};

  // combine two objects into a new object without changing the initial ones
  // properties from first b overwrite those from second
  function mergeObjects(first, second){
    var result = {};
    for (var key in first) {
      result[key] = first[key];
    }
    for (var key in second) {
      result[key] = second[key];
    }
    return result;
  }

   function receiveMessage(e) {
    // verify the domain to be safe, must match the config
    if (typeof config.iframeOrigin != &quot;undefined&quot; &amp;&amp; e['origin'].indexOf(config.iframeOrigin) &lt; 0) {
      return;
    }
    // merge the received override data with the utag.data on the page
    var messageObject = mergeObjects(config.messageObjectOverrides, e.data);
    // fire utag.view with the data
    logger(&quot;Received message object, utag.link fired with : &quot; + JSON.stringify(messageObject));
    utag.link(messageObject);
  }

  function logger(message) {
    console.info(&quot;IFRAME WRAPPER (TiQ)  ::&quot;, message);
  }

  // add the listener to the window
  window.addEventListener('message', receiveMessage);
  logger(&quot;Added listener to parent frame.&quot;)
}

